import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the min price input
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Set min and max price
    await page.fill('#minPrice', '100');
    await page.fill('#maxPrice', '500');

    // Take screenshot after filling price inputs
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_inputs_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_inputs_filled.png'));

    // Wait for and click the "Apply" button (by class and text)
    const applyBtn = await page.waitForSelector('.apply-filter', { timeout: 5000 });
    await applyBtn.click();

    // Wait for product grid/list to update (wait for a product card with price in range)
    // We'll look for a product card with price between 100 and 500
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_apply_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_apply_filter.png'));

    // Extract product titles and prices currently displayed (only those in the filtered range)
    const products = await page.$$eval('.product-card', cards =>
      cards.map(card => {
        const title = card.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = card.querySelector('.product-price')?.textContent || '';
        // Extract price as float
        const match = priceText.match(/\$([\d,.]+)/);
        const price = match ? parseFloat(match[1].replace(/,/g, '')) : null;
        return { title, price };
      }).filter(p => p.price !== null && p.price >= 100 && p.price <= 500)
    );

    return {
      success: true,
      action: "Applied price range filter (min $100, max $500) and extracted filtered product data",
      extractedData: {
        filteredProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
